from fastapi import FastAPI, HTTPException, status
from pydantic import BaseModel
from typing import List

app = FastAPI()

class SequenceInput(BaseModel):
    sequence: List[int]

class SumResponse(BaseModel):
    sum: int

@app.post("/api/v1/sum-sequence", response_model=SumResponse)
async def calculate_sum(sequence_input: SequenceInput):
    try:
        sequence = sequence_input.sequence
        if not isinstance(sequence, list):
            raise HTTPException(status_code=status.HTTP_422_UNPROCESSABLE_ENTITY, detail="Input must be a list.")
        if not all(isinstance(x, int) for x in sequence):
            raise HTTPException(status_code=status.HTTP_422_UNPROCESSABLE_ENTITY, detail="All elements in the list must be integers.")

        total_sum = sum(sequence)
        return SumResponse(sum=total_sum)
    except Exception as e:
        raise HTTPException(status_code=status.HTTP_500_INTERNAL_SERVER_ERROR, detail=str(e))

