import React, { useState } from 'react';
import axios from 'axios';

function SequenceSum() {
  const [sequence, setSequence] = useState('');
  const [sum, setSum] = useState(null);
  const [error, setError] = useState(null);

  const handleChange = (event) => {
    setSequence(event.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    setError(null);
    try {
      const sequenceArray = sequence.split(',').map(Number);
      const response = await axios.post('/api/v1/sum-sequence', { sequence: sequenceArray });
      setSum(response.data.sum);
    } catch (err) {
      setError(err.response?.data?.detail?.[0]?.msg || 'An error occurred');
    }
  };

  return (
    <div>
      <h1>Sequence Sum Calculator</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Enter a sequence of integers (comma-separated):
          <input type="text" value={sequence} onChange={handleChange} />
        </label>
        <button type="submit">Calculate Sum</button>
      </form>
      {error && <p style={{ color: 'red' }}>Error: {error}</p>}
      {sum !== null && <p>Sum: {sum}</p>}
    </div>
  );
}

export default SequenceSum;

